import React from 'react';
import { NavLink } from 'react-router-dom';
const Navigation = () => {
    return (
        <div>
            <NavLink to="/">
                <li>Accueil</li>
            </NavLink>
            <NavLink to="/about">
                <li>About</li>
            </NavLink>
            <NavLink to="/compteur">
                <li>Compteur</li>
            </NavLink>

        </div>
    );
};

export default Navigation;
